import React,{Fragment} from 'react'

let Home = () => {
    return (
        <Fragment>
            <div className='container mt-3'>
               <div className='row'>
                 <div className='col'>
                     <h1>User Details</h1>
                     <p className='lead'></p>
                 </div>
               </div>
            </div>
        </Fragment>
    )
}

export default Home;
